    private function importPlayer()
    {
    dd('停止匯入，因為已匯入完成，除了委員組的之外');
       AccountModel::truncate();PlayerModel::truncate();EnrollModel::truncate();
    //    $datas = $this->one();
       $datas = $this->two();
        foreach ($datas as $key => $data) {
            echo '.';
           AccountModel::updateOrCreate(['id' => $data->account_id], [
               'coach'   => $data->coach,
               'account' => $data->account,
           ]);

            foreach ($data->players as $player) {
                $teamName = $player->agency;
               PlayerModel::updateOrcreate(['id' => $player->player_number], [
                   'account_id' => $data->account_id,
                   'name'       => $player->name,
                   'gender'     => $player->gender,
                   'city'       => $player->city,
                   'agency'     => $teamName,
                   'coach'      => $player->coach,
                   'leader'     => $player->leader,
                   'manager'    => $player->manager,
               ]);

                foreach ($player->item as $item) {
                    $group = str_replace('男子組', '', $item->group);
                    $group = str_replace('女子組', '', $group);

                    $item = str_replace('(男)', '', $item->item);
                    $item = str_replace('(女)', '', $item);

                   EnrollModel::create([
                       'game_id'       => 1,
                       'player_id'     => $player->player_number,
                       'player_number' => $player->player_number,
                       'account_id'    => $data->account_id,
                       'group'         => $group,
                       'gender'        => $item == '雙人花式繞樁' ? '不分' : $player->gender,
                       'item'          => $item,
                   ]);
                }
            }
        }

        $this->info('done');
    }

